import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>Supermercado Antojitos</h1>
      <nav>
        <a href="/">Home</a>
        <a href="/sales">Sales</a>
        <a href="/inventory">Inventory</a>
      </nav>
    </header>
  );
};

export default Header;
